import { assertEquals } from "https://deno.land/std/testing/asserts.ts";


function maxValue(n: string, x: number): string {
    const sign = n.startsWith("-");
    if (sign) n = n.slice(1)

    let m = String(x) + n;

    for (let i = 0; i <= n.length; i++) {
        if (sign) {
            if (n[i] <= String(x)) continue;
        } else {
            if (n[i] >= String(x)) continue;
        }


        const v = n.slice(0, i) + String(x) + n.slice(i);
        console.log({ i, v, m })
        if (!m) {
            m = v;
            continue;
        }
        if (sign) {
            if (m > v) m = v;
        } else {
            if (m < v) m = v;
        }
    }

    if (sign) m = "-" + m;
    return m;
};


Deno.test("test", () => {
    assertEquals(maxValue("99", 9), "999");
})
Deno.test("test", () => {
    assertEquals(maxValue("-13", 2), "-123");
})
Deno.test("test", () => {
    assertEquals(maxValue("962942516613939", 3), "9632942516613939");
})

Deno.test("test", () => {

    const input = ""
    assertEquals(maxValue(input, 1), input + "1");
})

